import Link from 'next/link';

const Nav = () => (
    <div>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/about">
            <a>About</a>
        </Link>
        <button type="button" class="btn btn-primary">Primary</button>
    </div>
);

export default Nav;
